import logo from './logo.svg';
import './App.css';
import { ButtonSolid, Grid, Box, Text, Icon } from 'design-system';

function App() {
  return (
    <div className="App">
      <Box mt="30px" height="150px" bg="red">
        <Box mt="20px" pl="auto" pr="auto" pt="auto" pb="auto">
          <Text>Hi Anakin</Text>
        </Box>
      </Box>
      <Box height="150px" bg="white">

      </Box>
    </div>
  );
}

export default App;
